import React from "react";
import withSearch from "./WithSearch";
import { data } from "./Data";

const Home = ({ data }) => {
  return (
    <div>
      <ol>
        {data.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ol>
    </div>
  );
};

export default withSearch(
  Home,
  data.filter((item) => item.includes("Home"))
);
